import React from "react";
import { useNavigate } from "react-router-dom";
import cook from "../../IMAGES/cook.png";

export const HomePage = () => {
  const navigate = useNavigate();

  const handleAdmin = () => {
    navigate("/adminLog");
  };

  const handleMngr = () => {
    navigate("/managerLog");
  };

  return (
    <div className="flex border m-3 border-black">
      <div>
        <img src={cook} alt="Cook" />
      </div>
      <div className="border border-black w-full">
        <form className="m-auto border border-black my-5">
          <h1 className="text-[34px] font-bold text-center">Login as:</h1>
          <div className="my-3">
            <button className="py-2 px-4" onClick={handleAdmin}>Admin</button>
            <button onClick={handleMngr}>Manager</button>
          </div>
        </form>
      </div>
    </div>
  );
};
